import React, {useState} from "react";
import {Link, useParams} from "react-router-dom";
import {Button} from "reactstrap"

function UserSideBar() {
    const state = useState((state) => state)
    const id = state.auth.user_id

    return (
        <div className="hidden md:block w-full md:w-4/12 xl:w-3/12 bg-gray-200 pt-5 lg:p-6 rounded-sm ">
            <Link
                to={`/user/${id}`}
            >
                <Button active className="block py-3 px-4">
                    My Profile
                </Button>
            </Link>

            <div className="hidden md:block border-t w-2/3 my-2"/>

            <Link
                to={`/user/${id}/bookings`}

            >
                <Button className="block py-3 px-4">
                    My Bookings
                </Button>
            </Link>

            <div className="hidden md:block border-t w-2/3 my-2"/>

            <Button className="block py-3 px-4">
                Change password
            </Button>
        </div>
    );
}

export default UserSideBar;
